- uid: 2050
  type: BookBase
  components:
  - name: 'Хроники Нарнии: Лев, Колдунья и Платяной шкаф'
    type: MetaData
  - pos: -8.852309,31.68323
    parent: 0
    type: Transform
  - content: >
      Из-за бомбёжек Лондона четверых детей семьи Пэвэнси (Питера, Сьюзен, Эдмунда и Люси) отправляют к другу семьи, профессору Дигори Керку.Во время игры в прятки Люси прячется в Платяном шкафу, через который попадает в Нарнию, где знакомится с фавном Тумнусом. Тумнус рассказывает ей, что Нарния находится под властью Белой Колдуньи, захватившей страну и провозгласившей себя королевой; из-за неё в Нарнии вечная зима и никогда не бывает Рождества. Вернувшись к братьям и сестре, Люси рассказывает о своём приключении, однако те ей не верят. Позже, когда она во второй раз попадает в Нарнию, за ней следом идёт Эдмунд. Он встречает Белую Колдунью, которая поит и угощает его, тем самым подчиняя волю мальчика себе. Под благовидным предлогом она приказывает Эдмунду привести всех четырёх детей к ней в замок.Позже все четверо детей попадают в Нарнию и обнаруживают, что Тумнуса забрали слуги Джадис (как выяснилось, Эдмунд повторил колдунье рассказ Люси и тем самым выдал фавна). Детей встречает мистер Бобр и рассказывает о том, что Аслан уже в пути, а значит, начинает сбываться древнее пророчество о том, что придёт Аслан, кончится Долгая зима, и четыре человека станут правителями Нарнии, свергнув Белую колдунью. Во время рассказа Эдмунд сбегает и направляется к замку Королевы. Джадис злится на Эдмунда, так как тот не привел ей всех детей Певенси, и заковывает его. А тем временем Питер, Сьюзен, Люси и Бобры отправляются к Аслану. По дороге они встречают Санта-Клауса, который вручает им подарки: Питеру — меч и щит, Сьюзен — лук, стрелы и рог, Люси — кинжал и волшебный напиток из сока огненных цветов, одна капля которого излечивает любые раны. Встретившись с Великим Львом, дети просят его помочь спасти Эдмунда.Эдмунд же понимает, насколько он был не прав. Но всё же он стал предателем и теперь принадлежит королеве. Аслан совершает обмен: он остается в руках Белой Колдуньи, а Эдмунда отпускают. Ночью королева убивает Аслана, но последний воскресает, так как «когда вместо предателя на жертвенный Стол по доброй воле взойдёт тот, кто ни в чём не виноват, кто не совершал никакого предательства, Стол сломается, и сама Смерть отступит перед ним». На следующий день происходит сражение за Нарнию.Аслан помогает победить Белую Колдунью. После победы Питера провозглашают Питером Великолепным, верховным королём в Кэр-Паравеле, он правит Нарнией 15 лет вместе с сёстрами и братом: Сьюзен Великодушной, Люси Отважной и Эдмундом Справедливым. Как-то раз во время охоты на белого оленя они попадают обратно в Англию. Оказывается, что там не прошло и минуты.
    type: Paper
