  components:
  - name: Топ 6 способов разбогатеть, если вы Квартимейстер.
    type: MetaData
  - pos: 57.865158,6.6402855
    parent: 0
    type: Transform
  - content: >
      Топ 6 способов разбогатеть, если вы Квартимейстер.

      Способ первый - Уйти в отставку и надеяться на светлое будущее Каргонии.

      Способ второй - Заставить грузчиков тащить резервуары из технических помещений.

      Способ третий - Продать грузчика.

      Способ четвёртый - Надеяться, что утилизаторы притащат что-нибудь ценное.

      Способ пятый - Заставить атмосферных техников варить фрезон.

      Способ шестой - Продать всё хранилище.

      (Секретный способ седьмой) - Продать Капитана.
    type: Paper
